import React from 'react'
import { useNavigate } from 'react-router-dom';

function Header() {
    let navigate = useNavigate();

    return (
        <div>
            <header>
                <nav>
                    <ul>
                        <li onClick={() => {
                            navigate('/')
                        }}>
                            <a href=''>Home</a>
                        </li>
                        <li onClick={() => {
                            navigate('/portfolio')
                        }}>
                            <a href=''>Portfolio</a>
                        </li>
                        <li onClick={() => {
                            navigate('/about')
                        }}>
                            <a href=''>About</a>
                        </li>
                        <li onClick={() => {
                            navigate('/contact')
                        }}>
                            <a href=''>Contact</a>
                        </li>
                    </ul>
                </nav>
            </header>
        </div>
    );
}

export default Header
